import "./App.css";
import React from "react";
import { Provider } from "react-redux";
import store from "./store";
import "antd/dist/antd.css";
import "antd/lib/select/style/css"; // Import the Select component's CSS
import "antd/lib/button/style/css"; // Import the Button component's CSS
import "antd/lib/card/style/css";
import Floating from "./components/Floating";

function App() {
  <Provider store={store}>
    <React.StrictMode>
      <Floating />
    </React.StrictMode>
  </Provider>;
}

export default App;
